import { Link } from 'react-router-dom';

import './styles.css';

const Navbar = () => {
  return (
    <nav className="navbar main-nav">
      <Link to="/" className="">
        <h4 className="text-primary">Github API</h4>
      </Link>
    </nav>
  );
};

export default Navbar;
